import "./App.css";
import { Component } from "react";
import { render } from "@testing-library/react";
import PersonComponent from "./Person/PersonType";
import PersonFun from "./Person/PersonFun";

class App extends Component {
  state = {
    personsName: [
      { name: "Foivos", age: 28 },
      { name: "Evi", age: 27 },
    ],
  };
  render() {
    console.log(this.state.personsName);
    return (
      <div className="App">

        {console.log(this.state.personsName[0]["name"])}
        {console.log(this.state.personsName[1]["age"])}
        <h1>To App pou arxizw kai katalavainw</h1>
        <PersonComponent name={this.state.personsName[0]["name"]} />
        <PersonFun name={this} age="29" />
      </div>
    );
  }
}

export default App;
